	width: 440px;
	padding: 5px;
	padding-left: 7px;
	vertical-align: top;
	border: 1px solid #ccc;
}

table.table-devices {
	width: 560px;
	border-collapse: collapse;
	text-align: left;
	line-height: 1.5;
	font-size:12px;
	color:323232;
}

table.table-devices th {
	padding: 5px;
	padding-left: 7px;
	font-weight: normal;
	vertical-align: top;
	border: 1px solid #ccc;
}

table.table-devices th#top {
	padding: 5px;
	padding-left: 7px;
	font-weight: normal;
	text-align: center;
	vertical-align: top;
	border: 1px solid #ccc;
	background-color:ebebeb;

}

table.table-devices td {
	width: 440px;
	padding: 5px;
	padding-left: 7px;
	vertical-align: top;
	border: 1px solid #ccc;
